import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import { TextField, Button } from '@material-ui/core';
import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import green from '@material-ui/core/colors/green';
import HomeAppBar from '../components/HomeAppBar'

export default function Register() {
  const theme = createMuiTheme({
    overrides: {
      MuiAppBar: {
        colorPrimary: {
          backgroundColor: '#FFA474',
        },
      },
      MuiTextField: {
        colorPrimary: {
          backgroundColor: '#FFA474',
        },
      },
    },
    palette: {
      primary: {
        main: "#ffa474",
      },
      secondary: {
        main: green[500],
      },
    },
  });


  function testConnectionToLocalServer() {
    return fetch("https://sddmajordev:5000/test")
    .then(response => response.json())
    .then(data => {
      console.log('Success:', data);
    })
    .catch((err) => {
        console.log(err);
    });
  }

  useEffect(() => {
    testConnectionToLocalServer();
  }, []);

  function registerUser() {

  }

  return (
    <div className="App">
      <header className="App-header">
        <ThemeProvider theme={theme}>
            <TextField label="Email" color="primary" variant="outlined" ref="email"/>
            <br></br>
            <TextField label="Username" color="primary" variant="outlined" ref="username"/>
            <br></br>
            <TextField label="Password" color="primary" variant="outlined"/>
            <br></br>
            <TextField label="Confirm Password" color="primary" variant="outlined"/>
            <br></br>
            <Button onClick={registerUser()}>Go</Button>
        </ThemeProvider>
      </header>
    </div>
  );
}
